// 정수입력 => 
/* 입력 static int[] input()
 * 출력 static void(int[]) 
 * ===
 * 조합 static void
 */

import java.util.Scanner;

public class 연습4 {
	
	static int print()
	{
		int a=10;
		return a;
	}
	
	static void process(int a)
	{
		System.out.println(a);
	}
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a = print();
		process(a);

	}

}
